        <Item>
        <Item.Image size='small' src={`${props.item.image}`} />
        <Item.Content>
        <Item.Header> {props.item.name}</Item.Header>
    <Item.Meta></Item.Meta>
            <Item.Description>

            <br></br>

            </Item.Description>
    <Item.Extra>{props.item.description}</Item.Extra>
        </Item.Content>
        </Item>
        </Item.Group>
  );
}

export default Transaction
